--create table universities
create table if not exists universities(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uri text,
uri_red text
);

--create table teachingmethods
create table if not exists teachingmethods(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
uri text,
uri_ac_uk text
);

--create table teachers
create table if not exists teachers(
id integer primary key generated by default as identity,
name text not null check (name <> ''),
username text,
uri text
);

--create table subjects
create table if not exists subjects(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
code_acm_ccs text,
uci_uri text,
ou_cso_uri text
);

--create table students
create table if not exists students(
id integer primary key generated by default as identity,
name text not null check (name<> ''),
username varchar,
faculty varchar,
uri text
);

--create table rooms
create table if not exists rooms(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
uri text
);

--create table materials
create table if not exists materials(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
uri text,
extension text,
dir text
);

--create table languages
create table if not exists languages(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uri text
);

--create table faculties
create table if not exists faculties(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
uri text
);

--create table departments
create table if not exists departments(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uri text
);

--create table buildings
create table if not exists buildings(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uri text
);

--create table assessmentmethods
create table if not exists assessmentmethods(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uri text
);

--create table academicterms
create table if not exists academicterms(
id integer primary key generated by default as identity,
denomination text not null check (denomination<> ''),
description text,
uci_uri text
);

--create table courses
create table if not exists courses(
id integer primary key generated by default as identity,
denomination text not null check (denomination <> ''),
description text,
numberofcredits integer,
level varchar,
weeklyhours integer,
startdate date,
enddate date,
languageid integer references languages(id),
subjectid integer references subjects(id),
universityid integer references universities(id),
facultyid integer references faculties(id),
departmentid integer references departments(id),
teachingmethodid integer references teachingmethods(id),
buildingid integer references buildings(id),
roomid integer references rooms(id),
lonposition numeric,
latPosition numeric,
country text,
assessmentmethodid integer references assessmentmethods(id),
uri text,
teachinglevel varchar,
license text
);

--create table courses_teachers
create table if not exists courses_teachers(
id integer primary key generated by default as identity,
courseid integer references courses(id),
teacherid integer references teachers(id)
);

--create table courses_materials
create table if not exists courses_materials(
    id integer primary key generated by default as identity,
    courseid integer references courses(id),
    materialid integer references materials(id)
);

--create table courses_academicterms
create table if not exists courses_academicterms(
id integer primary key generated by default as identity,
courseid integer references courses(id),
academictermid integer references academicterms(id)
);

--create table courses_students
create table if not exists courses_students(
id integer primary key generated by default as identity,
courseid integer references courses(id),
studentid integer references students(id)
);

